You may spy a small yet mighty change to The HEARTest Yard logo this holiday season. Our year has been blessed beyond measure when the inspiration behind this charitable cause — our heart warrior TJ — received a successful heart transplant. TJ’s favorite color is lime green. The green ribbon represents organ donation and transplants. Pure coincidence? Probably not. 😉

Join us in lifting up organ donors and their families in this season of great hope, joy and love. As always, please keep heart babies, heart warriors and heart families in your heartfelt thoughts this holiday season and always. ❤️💚
